import Task from './Task'

const Tasks = ({tasks, onDelete, change}) => {
  console.log(tasks)
  return (
    <>
      {
        tasks.map(task => {
          return (
            <Task
              key={task.id}
              task={task}
              onDelete={onDelete}
              change={change}
            />
          )
        })
      }
    </>
  )
}

export default Tasks
